    "jq_1": { command: "jq", section: 1, description: "command-line JSON processor", content: "JQ(1)                     Manual Page                     JQ(1)\n\nNAME\n       jq - command-line JSON processor\n\nSYNOPSIS\n       jq [options] [arguments]\n\nDESCRIPTION\n       command-line JSON processor\n\n       A lightweight and flexible command-line JSON processor.\n\nCOMMON USAGE\n       jq '.' file.json                    Pretty-print JSON\n       jq '.field' file.json               Extract field\n       jq '.[]' file.json                  Iterate array\n       jq '.[] | select(.id > 5)'          Filter objects\n\n\nSEE ALSO\n       Full documentation available where this command is installed.\n\n" },
    "dnf_8": { command: "dnf", section: 8, description: "package manager for RPM-based distributions", content: "DNF(8)                                          Manual Page                                          DNF(8)\n\nNAME\n       dnf - package manager for RPM-based distributions\n\nSYNOPSIS\n       dnf [options] [arguments]\n\nDESCRIPTION\n       package manager for RPM-based distributions\n\n       This is a placeholder entry. On a full Linux system, this command provides:\n       - Next-generation yum\n       - Faster dependency resolution\n       - Module streams\n       - Rich command line\n\nCOMMON COMMANDS\n       install      Install package\n       upgrade      Upgrade packages\n       remove       Remove package\n       info         Package information\n\nSEE ALSO\n       Full documentation is available on systems where this command is installed.\n\n" },
    "yum_8": { command: "yum", section: 8, description: "Yellowdog Updater Modified package manager", content: "YUM(8)                                          Manual Page                                          YUM(8)\n\nNAME\n       yum - Yellowdog Updater Modified package manager\n\nSYNOPSIS\n       yum [options] [arguments]\n\nDESCRIPTION\n       Yellowdog Updater Modified package manager\n\n       This is a placeholder entry. On a full Linux system, this command provides:\n       - Install, update, remove packages\n       - Dependency resolution\n       - Repository management\n       - Package groups\n\nCOMMON COMMANDS\n       install      Install package\n       update       Update package\n       remove       Remove package\n       search       Search packages\n\nSEE ALSO\n       Full documentation is available on systems where this command is installed.\n\n" },
    "screen_1": { command: "screen", section: 1, description: "screen manager with VT100/ANSI terminal emulation", content: "SCREEN(1)                                          Manual Page                                          SCREEN(1)\n\nNAME\n       screen - screen manager with VT100/ANSI terminal emulation\n\nSYNOPSIS\n       screen [options] [arguments]\n\nDESCRIPTION\n       screen manager with VT100/ANSI terminal emulation\n\n       This is a placeholder entry. On a full Linux system, this command provides:\n       - Terminal multiplexing\n       - Detachable sessions\n       - Multiple windows\n       - Session sharing\n\nCOMMON COMMANDS\n       Ctrl-a c     Create window\n       Ctrl-a n     Next window\n       Ctrl-a d     Detach\n       -r           Reattach session\n\nSEE ALSO\n       Full documentation is available on systems where this command is installed.\n\n" },
    "sar_1": { command: "sar", section: 1, description: "collect, report, or save system activity information", content: "SAR(1)                                          Manual Page                                          SAR(1)\n\nNAME\n       sar - collect, report, or save system activity information\n\nSYNOPSIS\n       sar [options] [arguments]\n\nDESCRIPTION\n       collect, report, or save system activity information\n\n       This is a placeholder entry. On a full Linux system, this command provides:\n       - System activity data collection\n       - Historical performance data\n       - CPU, memory, I/O, network stats\n       - Report generation\n\nCOMMON OPTIONS\n       -u           CPU utilization\n       -r           Memory utilization\n       -d           Disk activity\n       -n           Network statistics\n\nSEE ALSO\n       Full documentation is available on systems where this command is installed.\n\n" },
