    "strace_1": { command: "strace", section: 1, description: "trace system calls and signals", content: "STRACE(1)                                          Manual Page                                          STRACE(1)\n\nNAME\n       strace - trace system calls and signals\n\nSYNOPSIS\n       strace [options] [arguments]\n\nDESCRIPTION\n       trace system calls and signals\n\n       This is a placeholder entry. On a full Linux system, this command provides:\n       - Trace system calls and signals\n       - Debug process interactions\n       - Performance analysis\n       - Security auditing\n\nCOMMON OPTIONS\n       -p pid       Attach to process\n       -e trace=    Trace specific calls\n       -o file      Output to file\n       -f           Follow forks\n\nSEE ALSO\n       Full documentation is available on systems where this command is installed.\n\n" },
